import React from 'react';
 // Ensure to import the custom CSS file

function Navbar() {
  return (
    <div>
      <nav className="navbar navbar-expand-lg navbar_custom">
        <div className="container-fluid justify-content-center">
          <a className="navbar-brand mx-auto" href="#">ToDo App</a>
          <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse center" id="navbarSupportedContent">
            <ul className="navbar-nav me-auto mb-2 mb-lg-0">
            </ul>
          </div>
        </div>
      </nav>
    </div>
  );
}

export default Navbar;
